import styled from "styled-components";
import { Header } from "../componentes/header.js";
import Search from "../componentes/Search";

export function HomeDinamica() {
  return (
    <Container>
      <Header />

      <div className="container">
        <Search />
        <div className="col1">
          <h1 className="texto-home">
            Mercad<span>i</span>nho do seu Zé
          </h1>
          <img src="" alt="" />
        </div>
      </div>
    </Container>
  );
}

export const Container = styled.div`
  background: #f4fdff;
  #nav-1 li a {
    color: #ffae10;
  }
  #nav-2 a {
    color: #ffae10;
  }
  .search-div input {
    background: #f4fdff;
    border: 3px solid #26768d;
    color: #26768d;
    margin-left: 0px;
  }
  .search-div input::placeholder {
    color: #26768d;
  }
  .container {
    .col1 {
      background: red;
      width: 50%;
      height: 500px;

      .texto-home {
      }
    }
  }
`;
